import React from "react";
import "./style.css";

function FriendCard(props) {
  return (
    <div className="card">
      <div className="img-container">
        <img
          alt="Mr. Krabs"
          src="https://vignette3.wikia.nocookie.net/vsbattles/images/8/80/Mr._Krabs.png/revision/latest?cb=20150919162131"
        />
      </div>
      <div className="content">
        <ul>
          <li>
            <strong>Name:</strong> {props.characterName}
          </li>
          <li>
            <strong>Occupation:</strong> {props.characterOccupation}
          </li>
          <li>
            <strong>Location:</strong> {props.characterLocation}
          </li>
        </ul>
      </div>
    </div>
  );
}

export default FriendCard;
